import React, { Component } from 'react';
import PopSearchBox from '../../components/search-box/PopSearchBox';
import './PopSearchHeaderStyles.scss'

import { connect } from 'react-redux';
import { change_pop_keyword } from '../../redux/pkeyword-action';


const mapStateToProps = state => {
	return {
		p_search: state.pkeyword.p_keyword
	}
};

const mapDispatchToProps = dispatch => {
	return {
		change_pkeyword: (event) => dispatch(change_pop_keyword(event.target.value))
	}
}

class PopSearchHeader extends Component {
	// constructor() {
	// 	super()
	// 	this.sate = {
	// 		p_searchkey: ""
	// 	}
	// }

	// componentDidMount() {
	// 	this.setState({p_searchkey: this.props.p_search})
	// }


	render() {
		// const{ p_search } = this.props;
		// console.log(this.props.p_search)
		const { p_search, change_pkeyword } = this.props;

		return(
			<div>
				<h1 className='pagetitle'>Pop Music Search</h1>
					<div class="search__container">
				    <p class="search__title">
				        Go ahead, hover over search
				    </p>
				    <input class="search__input" type="text" placeholder="Search" />
					</div>

					<div class="credits__container">
				    	<p class="credits__text">Background color: Pantone Color of the Year 2016 <a href="https://www.pantone.com/color-of-the-year-2016" class="credits__link">Rose Quartz</a></p>
					</div>
			</div>
		);
	}
}


export default connect(mapStateToProps, mapDispatchToProps)(PopSearchHeader);



